import {Routes as Routes} from 'react-router-dom';
import {Route as Route} from 'react-router-dom';
import {useState} from 'react';
import {Link} from 'react-router-dom';

function Contact(props){
    const { name } = props; // Destructure the prop
    const [tfvar, setTF] = useState(true);
    const handleClick = () => {
        setTF(tfvar!=tfvar);
    }
    return (
    <div>
        <p>{name}</p>
        <p>this is the contact page</p>
        <Link to path='localhost:3000/' onClick={handleClick}>Home</Link>
    </div>
    );
}
export default Contact;
